import React, { useEffect, useState } from 'react'
import './Climat.css'
import imgage1 from '../assets/image 14.png'
const Climat = () => {
  const [localStorageValue, setLocalStorageValue] = useState('');

  useEffect(() => {
    // Fetch the value from local storage
    const storedValue = localStorage.getItem('formData'); // Replace 'myKey' with the actual key you used to save the value

    // Update the state with the fetched value
    if (storedValue) {
      setLocalStorageValue(storedValue);
    }
  }, []);

  return (
    <div>
      <div className="Climat">

        <div className="mbox">
          <div className="song">
            <div>
              <img src={imgage1} className='earphone'></img>
            </div>
            <div className='naam'>
              <div className='firstName'>KK Vinay</div>
              <div className='firstName'>Vinay090@gmail.com</div>
              <div className='firstName'>vinay060</div>
              <div>
                {<p className='firstName'>{localStorageValue.Name}</p>}
              </div>
            </div>
          </div>
          <div className="temparature"></div>
        </div>

        <div className="mount"></div>
        
      </div>
    </div>
  );
}

export default Climat
